import React from "react";
import DataTable from "react-data-table-component";
import ReactTable from "react-table-6";
import data from "./data.json";

const columns = [
  {
    name: "Name",
    selector: "name",
    sortable: true,
  },
  {
    name: "Phone",
    selector: "phone",
    sortable: true,
  },
  {
    name: "Email",
    selector: "email",
    sortable: true,
  },
  {
    name: "DOB",
    selector: "dob",
  },
];

function Usertable() {
  return (
    <div className="App">
      <h3>
        DataTable in React -{" "}
        <a href="https://www.cluemediator.com" target="_blank">
          Clue Mediator
        </a>
      </h3>
      <DataTable
        title="Employees"
        columns={columns}
        data={data}
        pagination
        highlightOnHover
      />
    </div>
  );
}

export default Usertable;
